const list_question = (exam_id) => {
  let list = [];
  fake_question_list.map((question) => {
    if (question.exam_id !== Number(exam_id)) return null;
    let correctAnswer;
    switch (question.correctAnswer) {
      case 0:
        correctAnswer = 'A';
        break;
      case 1:
        correctAnswer = 'B';
        break;
      case 2:
        correctAnswer = 'C';
        break;
      case 3:
        correctAnswer = 'D';
        break;

      default:
        correctAnswer = 'A';
        break;
    }
    list.push({
      ...question,
      correctAnswer: correctAnswer,
    })
    return null;
  });
  return list;
};

